import React from 'react';
import './Body.css'

export default function Item(props){

    const count = 0;

    function plus(){
        count++;
    }

    function minus(){
        if(count!=0){
            count--;
        }
    }

  return(
      <div className= "item">
        <h4 className = "itemtext">{props.Item}: ${props.Price}</h4>
        <div className = 'btns'>
            <button onclick="plus()" className="pos">+</button>
            <h1 className = "count">{count}</h1>
            <button onclick="minus()" className="neg">-</button>
        </div>
      </div>
  )
}
